import React from 'react';
import { Card, Grid, Image, Icon } from 'semantic-ui-react';
import equal from 'fast-deep-equal';

const DEFAULT_STATE = {
    users: []
};

const usersMinCard = (users) => {
    return users.map((user, i) => {
        const {img_link, firstname, latitude} = user;
        return (
            <Card>
                <Image src={img_link}  key={i} wrapped ui={false} />
                <Card.Content>
                    <Card.Header>{firstname.trim()}</Card.Header>
                    <Card.Meta>
                        <span className='date'>{firstname.trim()}</span>
                    </Card.Meta>
                    <Card.Description>
                        Matthew is a musician living in Nashville.
                    </Card.Description>
                </Card.Content>
                <Card.Content extra>
                    <a>
                        <Icon name='user' />
                        22 Friends
                    </a>
                </Card.Content>
            </Card>
        )
    });
};

class UserMiniCard extends React.Component {

    constructor(props){
        super(props);
        this.state = {...DEFAULT_STATE};
    }

    componentDidUpdate(prevProps) {
        if(!equal(this.props.users, prevProps.users)) {
            this.setState({users: this.props.users});
        }
    }
    render() {
        const { users } = this.state;
            if (users && users.length) {
               {usersMinCard(users)}
            }
                return null;
    }
}
export default UserMiniCard;
